rther 2 by separate negotiation)',33,'request',0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(6,'977bc550-5069-11e9-a14e-635e0fd3bfa6',NULL,NULL,'1','2',NULL,NULL,2,2,2,NULL,'GB','Oristano Stazione F.s., Oristano, ','','Province of Oristano','Italy','09170','39.90105570554223','8.60587392065429',1,'2019-03-27 10:07:00','2021-10-12 13:00:00','Lux LoftApartment Nr City Centre with GatedParking','A ground floor light filled spacious apartment with amazing décor perfect for singles, couples, a romantic retreat, a group of friends, families and business travel. A stone\'s throw from City Centre with easy quick transport links or walking. 15/20 min walk to City Centre . 10 min walk to Cardiff City Stadium. The stunning galleried bedroom area is on a mezzanine level overlooking a large living area. Secure Private Parking and Bike Shed in gated courtyard and outside seating area.',27,'instant',0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(7,'977bc550-5069-11e9-a14e-635e0fd3bfa6',NULL,NULL,'1','5',NULL,NULL,6,4,4,NULL,'GB','69 Commercial Street',NULL,'Greater London','England','E1 7NE','51.51743291864772','-0.07390837724608446',1,'2019-03-27 10:09:22','2021-10-12 13:00:00','Historic and Stunning, Large Central Bedford House','Amazing Georgian home which can accommodate several families (up to 20+): roaring fires, kitchen range vast living rooms (can be candlelit throughout), third-acre garden; lawn tennis, swimming, piano. Our home is in the centre of Bedford, close for shopping, a huge variety of restaurants and pubs. A five minute walk to the town and beautiful river beyond; less to the bus station, and ten to the railway station with easy access to London (35 minutes) and a short drive (45 minutes) to Cambridge.',NULL,'request',0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(8,'3f8e47b0-904e-11eb-8b7d-d3bb664c51db',NULL,NULL,NULL,'1',NULL,NULL,1,4,1,NULL,'CH','Rue du valentin','75','Jura-Nord vaudois District','VD','1400','46.7736966','6.6408289',1,'2021-10-08 14:51:08','2021-10-12 1